import React from 'react'
import { NavLink } from 'react-router-dom'

const Home = () => {

    const logout = async (e) => {
        e.preventDefault()
        const username = inputField.username
        const password = inputField.password
        try {
            const admin = await axios.post('https://login-api.web2rise.in/api/login', { username, password })
            const token = admin.data.token
            console.log(token)
            if (token) {
                navigate('/Home')
            }
            localStorage.setItem('token', token)
        } catch (error) {
            console.log('error', error)
        }
    }

    return (
        <>
            <div className='main_div'>
                <ul className='child_div'>
                    <NavLink className='create_user' to="/CreateUser"><li className='create_user1'>Create User</li></NavLink>
                    <NavLink className='create_user' to="/User"><li className='create_user2'>User</li></NavLink>
                    <NavLink className='create_user' to="/" onClick={logout} ><li className='create_user2'>Logout</li></NavLink>
                </ul>
            </div>
        </>
    )
}

export default Home
